import React, { useEffect, useState } from 'react';
import TestCmp from '../components/testCmp';

function Test() {
  const [images, setImages] = useState([]);

  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/photos')
      .then((response) => response.json())
      .then((data) => {
        setImages(data);
      });
  }, []);

  return (
    <div>
      <TestCmp data={images} />
    </div>
  );
}

export default Test;
